import { Component } from '@angular/core';

@Component({
  selector: 'app-doctor',
  templateUrl: './doctor.component.html',
  styleUrls: ['./doctor.component.css']
})
export class DoctorComponent {
 appointments: any[] = [
    { date: new Date('2023-11-15T10:00:00'), time: new Date('2023-11-15T10:00:00') },
    { date: new Date('2023-11-16T14:30:00'), time: new Date('2023-11-16T14:30:00') }
  ];

  newAppointment: { date: string, time: string } = { date: '', time: '' };

  editAppointment(appointment: any) {
    // Logic to edit the appointment
    console.log('Edit appointment:', appointment);
  }

  cancelAppointment(appointment: any) {
    const index = this.appointments.indexOf(appointment);
    if (index !== -1) {
      this.appointments.splice(index, 1);
    }
  }

  addAppointment() {

    this.appointments.push({
      date: new Date(this.newAppointment.date),
      time: new Date(this.newAppointment.time)
    });
    // Clear the form fields after adding a new appointment
    this.newAppointment = { date: '', time: '' };
  }
}
<div class="doctor-container">
    <h2>Hello, Doctor</h2>

    <h3>My Slots</h3>
    <table>
      <!-- Table header for existing appointments -->
      <thead>
        <tr>
          <th>Date</th>
          <th>Time</th>
        </tr>
      </thead>
      <!-- Table body for existing appointments -->
      <tbody>
        <tr *ngFor="let appointment of appointments">
          <td>{{ appointment.date | date:'dd/MM/yy' }}</td>
          <td>{{ appointment.time | date:'hh:mm a' }}</td>
          <td>
            <button (click)="editAppointment(appointment)">Edit</button>
            <button (click)="cancelAppointment(appointment)">Cancel</button>
          </td>
        </tr>
      </tbody>
    </table>

    <h3>Create New Slot</h3>
    <!-- Form for creating a new appointment -->
    <div class="form-group">
      <label for="slotDate">Date:</label>
      <input type="date" id="slotDate" [(ngModel)]="newAppointment.date" name="slotDate" required>
    </div>
    <div class="form-group">
      <label for="slotTime">Time:</label>
      <input type="time" id="slotTime" [(ngModel)]="newAppointment.time" name="slotTime" required>
    </div>
    <button (click)="addAppointment()">Add Slot</button>
  </div>
